import React from "react";

class Comp extends React.Component{
    constructor(props){
        super(props)
        this.state={
            count:0
        }
    }
    p=()=>{
        this.setState({count:this.state.count+1})
    }
    d = ()=>{
        this.setState({count:this.state.count-1})
    }
    render(){
    return  (
    <div>
    <button onClick={e=>this.p()}>i</button><br></br>
    <p>{this.state.count}</p><br></br>
    <button onClick={e=>this.d()}>d</button>
    </div>
    )
    }
}

export  {Comp}
